<script>

//https://leetcode.com/problems/fibonacci-number/

/**
 * @param {number} n
 * @return {number}
 */
var fib = function(n) {
    fibs = []
    fibs[0] = 0
    fibs[1] = 1

    for(let i = 2; i <= n; i++){
        fibs[i] = fibs[i-1] + fibs[i-2]
    }

    return fibs[n]
};

</script>
